import React from 'react';
import ReactPlayer from "react-player"

export default function video() {
  return (
    <div className="video-div">
      <ReactPlayer url="./img/jack.jpg" controls={true} />
      <img src="./pic_placeholder.png" />
    </div>
  )
}
